function Navbar() {
  return (
    <nav style={styles.nav}>
      <h2>Job Portal</h2>
      <div>
        <button style={styles.btn}>Home</button>
        <button style={styles.btn}>Login</button>
        <button style={styles.btn}>Admin</button>
      </div>
    </nav>
  );
}

const styles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    padding: "15px 30px",
    background: "#0f172a",
    color: "white",
  },
  btn: {
    marginLeft: "10px",
    padding: "8px 15px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default Navbar;
